import React from 'react'

class Home extends React.Component{

    render (){
        return (
            <div className="homePage">
                <div className="fullscreen-video-wrap">
                    <video src="https://cdn.videvo.net/videvo_files/video/free/2020-01/small_watermarked/191126_2_HD_Party_Cropped_10_preview.webm" autoPlay={true} loop={true}></video>
                </div>
            </div>
        )
    }
}
export default Home;
